      //------------------------------------------------
      function CopyToClipboard(text) {
        //alert(text);
        dummy = document.createElement('textarea');
        document.body.appendChild(dummy);
        dummy.value = text;
        dummy.select();
        try {
            successful = document.execCommand('cut');
            if (!successful) { alert('ERROR: Failed to copy "' + text + '" to clipboard'); }
        }
        catch (err) {
            alert('ERROR: Failed to copy "' + text + '" to clipboard: ' + err);
        }
        document.body.removeChild(dummy);
      }
